import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Main Page and Login Pages
import MainPage from './MainPage';
import AdminLogin from './admin/pages/AdminLogin';
import EmployeeLogin from './employee/pages/EmployeeLogin';
import TrainerLogin from './trainer/pages/TrainerLogin';

// Importing Admin Pages
import IssueResolution from './admin/pages/IssueResolution';
import LogoutAdmin from './admin/pages/Logout';
import ReportGeneration from './admin/pages/ReportGeneration';
import Settings from './admin/pages/Settings';
import SystemMonitoring from './admin/pages/SystemMonitoring';
import UserManagement from './admin/pages/UserManagement';

// Importing Employee Pages
import LearningDevelopment from './employee/pages/LearningDevelopment';
import LogoutEmployee from './employee/pages/Logout';
import RequestLearningPlan from './employee/pages/RequestLearningPlan';
import RequestQuestionBank from './employee/pages/RequestQuestionBank';
import SelfAssessment from './employee/pages/SelfAssessment';
import SubmitFeedback from './employee/pages/SubmitFeedback';

// Importing Trainer Pages
import Curriculum from './trainer/pages/Curriculum';
import DownloadQuestionBankPage from './trainer/pages/DownloadQuestionBankPage';
import FeedbackPage from './trainer/pages/FeedbackPage';
import GenerateQuestionBankPage from './trainer/pages/GenerateQuestionBankPage';
import ReviewQuestionBank from './trainer/pages/ReviewQuestionBank';



// Importing the Unified Dashboard
import Dashboard from './trainer/pages/Dashboard';  // Assuming Dashboard.js is in this directory

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Main Route */}
          <Route path="/" element={<MainPage />} />

          {/* Admin Login Route */}
          <Route path="/admin/login" element={<AdminLogin />} />
          
          {/* Employee Login Route */}
          <Route path="/employee/login" element={<EmployeeLogin />} />
          
          {/* Trainer Login Route */}
          <Route path="/trainer/login" element={<TrainerLogin />} />

          {/* Unified Dashboard Routes */}
          <Route path="/admin/dashboard" element={<Dashboard role="admin" />} />
          <Route path="/employee/dashboard" element={<Dashboard role="employee" />} />
          <Route path="/trainer/dashboard" element={<Dashboard role="trainer" />} />

          {/* Admin Routes */}
          <Route path="/admin/issue-resolution" element={<IssueResolution />} />
          <Route path="/admin/logout" element={<LogoutAdmin />} />
          <Route path="/admin/report-generation" element={<ReportGeneration />} />
          <Route path="/admin/settings" element={<Settings />} />
          <Route path="/admin/system-monitoring" element={<SystemMonitoring />} />
          <Route path="/admin/user-management" element={<UserManagement />} />

          {/* Employee Routes */}
          <Route path="/employee/learning-development" element={<LearningDevelopment />} />
          <Route path="/employee/logout" element={<LogoutEmployee />} />
          <Route path="/employee/request-learning-plan" element={<RequestLearningPlan />} />
          <Route path="/employee/request-question-bank" element={<RequestQuestionBank />} />
          <Route path="/employee/self-assessment" element={<SelfAssessment />} />
          <Route path="/employee/submit-feedback" element={<SubmitFeedback />} />

          {/* Trainer Routes */}
          <Route path="/trainer/curriculum" element={<Curriculum />} />
          <Route path="/trainer/download-question-bank" element={<DownloadQuestionBankPage />} />
          <Route path="/trainer/feedback" element={<FeedbackPage />} />
          <Route path="/trainer/generate-question-bank" element={<GenerateQuestionBankPage />} />
          <Route path="/trainer/review-edit-question-bank" element={<ReviewandEditQuestionBankPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
